column2:
@nico_eth Amongst other things, yes.

And while I disagree with the original concept of "clubhouses", I also disagree that web3 is only distributed, and doesn't need centres (if only temporary) or retreats.

I think there needs to be a balance.

@nico_eth I hear you, and I certainly agree that the tech underpinning web3 doesn't need centres.

But don't absolutely rule out our needs as humans to be social. 

Perhaps we don't need permanent centres, but wanting to meet IRL is part of the human condition.

@CoinbaseCloud Really hope Coinbase can do what is necessary to support the stability of the network.

Without this, there will be no merge, and you will be slowing down this ecosystem's efforts to become more environmentally sustainable.

Prolonging PoW = corporate social *irresponsibility*.

@JimmyRagosa Yes.

Or developing in the open. This prevents you from making any kind of splash. Users sometimes respond to a splash, especially if it is followed up by a regular drip.

By starting with little random drips, or a slow and steady pour, users may not feel anything to react to.

@matthewdif @furter_samuel Clone your repos.

Be ready to start using wireless LANs to share information.

Be ready to join a mesh.

@AnettRolikova @lwsnbaker @EthereumDenver I don't know where this went, ask @ETHGlobal @TheRealKartik 

But Bill was building web3 Discord:

https://t.co/UxSTbCXhzw

@BrantlyMillegan Bravo Brantly!

And even though we've never met, and we've barely interacted, I consider you my friend, and you can consider me yours.

You are a credit to the ecosystem!

@antiprosynth I understand, and in the longer term I agree.

I just can't help but think that the concept of a *second* (!!!) cryptocurrency emerging and overtaking, will be enough to spook many lay-investors.

I also expect that it will take time for a new top dog to learn how to be top dog.

